import "./chart.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const VMdata = [
    {
      name: "Last Week",
    "ActiveVMs": 41,
    "InactiveVMs": 85,
    "ActiveNetwork": 242,
    "InactiveNetwork": 239,
    },
    {
      name: "Monday",
    "ActiveVMs": 30,
    "InactiveVMs": 139,
    "ActiveNetwork": 221,
    "InactiveNetwork": 34,
    },
    {
      name: "Tuesday",
    "ActiveVMs": 20,
    "InactiveVMs": 98,
    "ActiveNetwork": 229,
    "InactiveNetwork": 141,
    },
    {
      name: "Wednesday",
    "ActiveVMs": 278,
    "InactiveVMs": 398,
    "ActiveNetwork": 2,
    "InactiveNetwork": 244,
    },
    {
      name: "Thursday",
    "ActiveVMs": 189,
    "InactiveVMs": 48,
    "ActiveNetwork": 218,
    "InactiveNetwork": 341,
    },
    {
      name: "Friday",
    "ActiveVMs": 239,
    "InactiveVMs": 38,
    "ActiveNetwork": 250,
    "InactiveNetwork": 4,
    },
    {
        name: " ",
    "ActiveVMs": 145,
    "InactiveVMs": 42,
    "ActiveNetwork": 0,
    "InactiveNetwork": 556,
      }
  ];

  const NetworkData = [
    {
        name: "Last Week",
    "ActiveNetwork": 242,
    "InactiveNetwork": 239,
    },
    {
      name: "Monday",
    "ActiveNetwork": 221,
    "InactiveNetwork": 34,
    },
    {
      name: "Tuesday",
    "ActiveNetwork": 229,
    "InactiveNetwork": 141,
    },
    {
      name: "Wednesday",
    "ActiveNetwork": 2,
    "InactiveNetwork": 244,
    },
    {
      name: "Thursday",
    "ActiveNetwork": 218,
    "InactiveNetwork": 341,
    },
    {
      name: "Friday",
    "ActiveNetwork": 250,
    "InactiveNetwork": 4,
    },
    {
      name: " ",
    "ActiveNetwork": 0,
    "InactiveNetwork": 556,
      }
  ];





export default function Chart() {
    return (
        <div className="chart">
            <h3 className="chartTitle">Virtual Machines</h3>
            <ResponsiveContainer width="100%" aspect= {6 / 1}>
                <LineChart data={VMdata}>
                    <XAxis dataKey="name" stroke="teal" />
                    <Line type="natural" dataKey="ActiveVMs" stroke ="green" />
                    <Line type="natural" dataKey="InactiveVMs" stroke ="red" />
                </LineChart>
            </ResponsiveContainer>

            <h3 className="chartTitle">Network</h3>
            <ResponsiveContainer width="100%" aspect= {6 / 1}>
                <LineChart data={NetworkData}>
                    <XAxis dataKey="name" stroke="teal" />
                    <Line type="natural" dataKey="ActiveNetwork" stroke ="green" />
                    <Line type="natural" dataKey="InactiveNetwork" stroke ="red" />
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}
